export default function manageProjectsMasterList(state = {
    loading: false,
    projects: []
}, action){
    switch (action.type) {
        case 'LOADING_PROJECTS':
            debugger
        return{
            ...state, 
            loading: true
        }

        case 'RETURNED_PROJECTS_DATA':
        debugger
        state.projects = action
        return {
            ...state
        }



        default:
           return state;
    }
}
